svg.script:
//
const artwork=document.getElementById('seedsArtwork');
const textElement=document.getElementById('seedNumber');
const sig=artwork.getElementById('signature');
artwork.classList.add('js');
artwork.classList.add('reveal');
artwork.classList.add('depth');

artwork.setAttribute("width","100%");
artwork.setAttribute("height","100%");
artwork.setAttribute('tabindex','0');
artwork.focus();

let holdThreshold=2200;
let isSpinClassActive=false;
let holdTimer;

// SEED RENDERER
function updateSVGWithSeed(seed){
  const lrElements=Array.from(document.querySelectorAll('.lr'));
  lrElements.forEach(element=>{element.classList.remove('on')});

  function setLayersVisibility(seed){
    for(let i=0;i<lrElements.length;i++){
      const isVisible=(seed & BigInt(1)<<BigInt(i))!==0n;
      lrElements[i].classList.toggle('on',isVisible);
    }
  }
  setLayersVisibility(seed);
  textElement.textContent=seed.toString();
}

function mutationCallback(mutationsList,observer){
  for(const mutation of mutationsList){
    if(mutation.type==='attributes'&& mutation.attributeName==='data-seed'){
      const newSeedValue=BigInt(mutation.target.getAttribute('data-seed'));
      updateSVGWithSeed(newSeedValue);
    }
  }
}

// SEED ATTRIBUTE OBSERVER
const mutationObserverOptions={attributes:true,};
var seed;

// Create a new Mutation Observer
const mutationObserver=new MutationObserver(mutationCallback);

// Observe changes to the data-seed attribute
mutationObserver.observe(artwork,mutationObserverOptions);

// Initialize the SVG with the initial seed value from the data-seed attribute
const initialSeed=BigInt(artwork.getAttribute('data-seed'));
updateSVGWithSeed(initialSeed);

// Event listener to receive seed number from the parent document
window.addEventListener('message',function(event){
  if(event.data && typeof event.data.seed==='bigint'){
    updateSVGWithSeed(event.data.seed);
  }
  seed=artwork.getAttribute('data-seed');
});

//
